import { getIntegrationToken } from '@commercelayer/js-auth'
import CommerceLayer from '@commercelayer/sdk'
import { NextApiRequest, NextApiResponse } from 'next'
import { findFontVariantById } from '../../../../lib/sanity.client'
import { getAsyncOrder, getOrder } from '../../../../utils/getOrder'
import { isValidOrderIdFormat } from '../../../../utils/isValidOrderIdFormat'

export default async function handler(
  req: NextApiRequest,
  res: NextApiResponse
) {
  if (req.method !== 'GET') {
    return res.status(405).end()
  }
  const { id, access_token } = req.query
  if (!isValidOrderIdFormat(id)) {
    return res.status(400).end()
  }
  // maybe get access token from query parameter?
  // @TODO: what about passing the `accessToken` as an request header?
  // because the access token expires and if the user saves the link it will become problematic
  // yes, and init a web app client, not an integration
  /*
  const client = CommerceLayer({
    organization: "or-type-mvp",
    accessToken,
    domain: process.env.CL_DOMAIN
  })
  */
  const token = await getIntegrationToken({
    clientId: process.env.CL_SYNC_CLIENT_ID,
    clientSecret: process.env.CL_SYNC_CLIENT_SECRET,
    endpoint: process.env.CL_ENDPOINT,
  })
  const client = CommerceLayer({
    organization: 'or-type-mvp',
    accessToken: token.accessToken,
    domain: process.env.CL_DOMAIN,
  })
  const orderResource = await getAsyncOrder(client, id)
  if (!orderResource?.id) {
    return res.status(404).end()
  }

  const skus = orderResource.line_items.filter(
    (item) => item.item_type === 'skus'
  )
  const deliverables = await Promise.all(
    skus.map(async (sku) => {
      const sanityFont = await findFontVariantById(sku.sku_code)
      // is `sku` in this map actually just a line item or a true sku?
      // filter `sanityFont` metafields by platform based on `sku.line_item_options[].name/reference`
      // pulling the values off of the metadata is similar to using the line_item_options
      const size = sku.metadata?.license.size
      const types = sku.metadata?.license.types
      // return font file to deliver
      return sanityFont.slug.current
    })
  )
  console.log(deliverables)

  const zip =
    ''
  // use archiver to zip file streams from xhr request to sanity url
  res.setHeader('Content-Type', 'application/zip')
  res.setHeader(
    'Content-Disposition',
    `attachment; filename=${orderResource.number}.zip`
  )
  const buffer = Buffer.from(zip, 'base64')
  res.setHeader('Content-Length', buffer.length)
  res.write(buffer)
  res.status(200).end()
}
